import React from 'react';
import styles from './Popup.module.css';
import logo from '../../assets/logo@2x.png';

const Popup = () => {
  return (
    <div className={styles.popup}> 
      <img src={logo} alt="Logo" className={styles.logo} />
      <h1 className={styles.title}>Book your appointment</h1>
      <h3 className={styles.subtitle}>Get free consultation</h3>
      <div className={styles.inputHolder}>
        <input type="text" placeholder="Name" className={styles.input} />
        <input type="text" placeholder="Phone Number" className={styles.input} />
        <input type="text" placeholder="Location Of your plot" className={styles.input} />
      </div>  
      <button className={styles.submitButton}>Submit</button>
    </div>
  );
}

export default Popup;
